import React from 'react';
import './NewExpense.css';
import "./ExpenseForm.css";
import ExpenseForm from './ExpenseForm'
import "../Expenses/Expenses.css";
import addExpense from './AddExpenses';
const NewExpense=(props)=>{
    const[addExpenses, setAddExpenses]=React.useState(f1);
    function f1(){
        <div className="new-expense__actions new-expense button">
           <button onClick={clickHandler}> Add Expenses</button>
         </div>
    }
    function f2(){
        <div className='new-expense'>
            <ExpenseForm onSaveExpenseData={saveExpenseDataHandler}/>
        </div>
    }
    const saveExpenseDataHandler=(enteredExpenseData)=>{
        const expenseData={
            ...enteredExpenseData,
            id:Math.random()+"",
        };
        props.onAddingExpense(expenseData)
    }

    const clickHandler =()=>{
        setAddExpenses(f2);
    }
    return(
    //     <div className="new-expense__actions new-expense button">
    //     <button onClick={clickHandler}> Add Expenses</button>
    //   </div>
        {addExpenses}
        // <addExpenses onSaveExpenseData={{saveExpenseDataHandler}}></addExpenses>
        
    )
}
export default NewExpense ;
